    margin-left: 2rem;
    background-color: black;
    min-width: 6%;
`;

export const Year = styled.div`
    color: white;
    text-align: center;
    padding-top: 10px;
`;

export const Month = styled.div`
    color: white;
    text-align: center;
    padding-top: 10px;
`;

export const Day = styled.div`
    font-size: 20px;
